import React, { useState } from 'react';
import { useCart } from '../../context/CartContext';
import { useNavigate } from 'react-router-dom';

interface ShippingAddress {
    firstName: string;
    lastName: string;
    street: string;
    city: string;
    region: string;
    regionCode: string;
    postalCode: string;
    country: string;
    countryCode: string;
    telephone: string;
    saveInAddressBook?: boolean;
    pickupLocationCode?: string;
}

const ShippingForm: React.FC = () => {
    const { setShippingAddress } = useCart();
    const [address, setAddress] = useState<ShippingAddress>({
        firstName: '',
        lastName: '',
        street: '', // Traktowane jako pojedynczy string
        city: '',
        region: '',
        regionCode: '',
        postalCode: '',
        country: 'Polska',
        countryCode: 'PL',
        telephone: '',
        saveInAddressBook: false,
        pickupLocationCode: ''
    });

    const navigate = useNavigate();

    const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
        setAddress({
            ...address,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e: React.FormEvent) => {
        e.preventDefault();
        try {
            // Przygotowanie obiektu z poprawnym typem `string[]` dla `street`:
            const addressWithArrayStreet = {
                ...address,
                street: [address.street], // Konwersja do string[]
                regionCode: address.regionCode,
                country: address.country,
                countryCode: 'PL'
            };

            await setShippingAddress(addressWithArrayStreet as unknown as ShippingAddress); // Typujemy jako ShippingAddress, wymuszając zgodność typu
            navigate('/payment');
        } catch (error) {
            console.error("Wystąpił błąd podczas ustawiania adresu:", error);
        }
    };

    return (
        <form className="shipping-form" onSubmit={handleSubmit}>
            <h3>Adres dostawy</h3>
            <input type="text" name="firstName" placeholder="Imię" onChange={handleChange} required />
            <input type="text" name="lastName" placeholder="Nazwisko" onChange={handleChange} required />
            <input type="text" name="street" placeholder="Adres (ulica)" onChange={handleChange} required />
            <input type="text" name="city" placeholder="Miasto" onChange={handleChange} required />
            <select name="regionCode" onChange={handleChange} required>
                <option value="">Wybierz województwo</option>
                <option value="PL-02">dolnośląskie</option>
                <option value="PL-04">kujawsko-pomorskie</option>
                <option value="PL-06">lubelskie</option>
                <option value="PL-08">lubuskie</option>
                <option value="PL-14">mazowieckie</option>
                <option value="PL-12">małopolskie</option>
                <option value="PL-16">opolskie</option>
                <option value="PL-18">podkarpackie</option>
                <option value="PL-20">podlaskie</option>
                <option value="PL-22">pomorskie</option>
                <option value="PL-24">śląskie</option>
                <option value="PL-26">świętokrzyskie</option>
                <option value="PL-28">warmińsko-mazurskie</option>
                <option value="PL-30">wielkopolskie</option>
                <option value="PL-32">zachodniopomorskie</option>
                <option value="PL-10">łódzkie</option>
            </select>
            <input type="text" name="postalCode" placeholder="Kod pocztowy" onChange={handleChange} required />
            <input type="text" name="telephone" placeholder="Telefon" onChange={handleChange} required />
            <input type="checkbox" name="saveInAddressBook" onChange={(e) => setAddress({
                ...address,
                saveInAddressBook: e.target.checked
            })} /> Zapisz w książce adresowej
            <input type="text" name="pickupLocationCode" placeholder="Kod lokalizacji odbioru" onChange={handleChange} />
            <button type="submit">Przejdź do płatności</button>
        </form>
    );
};

export default ShippingForm;
